import BlueDice1 from './assets/dice-blue-1.svg';
import RedDice1 from './assets/dice-red-1.svg';

const velue = {
    blue : BlueDice1,
    red : RedDice1,
};

function Dice(velue) {
    return (
    <div>
        <img src={velue} alt={'주사위'} />
        <img src={BlueDice1} alt='주사위' />
    </div>
    );
}

export default Dice;
